import React, { Component } from 'react';
import './heading.css'


class Heading extends Component {
    render() { 
      return(
        <nav className="navbar navbar-expand-sm navbar-light bg-light">
          <img src={teamLogoImg} className="navbar-brand"></img>
          <ul className="navbar-nav">
            <li className="nav-item"><a href="/">Home</a></li>
            <li className="nav-link"><a href="/">Document</a></li>
            <li className="nav-link"><a href="/">About us</a></li>
            <li className="nav-link">|</li>
            <li className="nav-link"><a href="/">Sign up</a></li>
            <li className="nav-link"><a href="/">Log in</a></li>
          </ul>
        </nav>  
      );
    }
}
const teamLogoImg = require('./court-logo.png');
export default Heading;
